import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Nav from "./components/Nav";

function App() {
  return (
    <Router>
      <div className="">
        <Nav />
        <div className="min-h-screen bg-gray-600 text-white">
                  {/* Hero section */}
                  <h1>Pushing Boundaries daily</h1>
        </div>
      </div>
    </Router>
  );
}

export default App;
